class ReadSpecToXls(object):
    def __init__(self, spec_path, result_path, ip_url, test_headers, test_body, test_result=[]):
        self.spec_path = spec_path
        self.result_path = result_path
        self.ip_url = ip_url
        self.test_headers = test_headers
        self.result_value = test_result
        self.wb = openpyxl.load_workbook(r'%s/Spec/%s' % (os.path.abspath('.'), spec_path))
        self.ws = self.wb['Spec']
        self.ws.title = 'Spec Result'
        self.ws2 = self.wb.create_sheet(title='Test Result')
        self.ws2.cell(row=1, column=1, value='Hostname:')
        self.ws2.merge_cells(start_row=1, start_column=2, end_row=1, end_column=10)
        self.ws2.merge_cells(start_row=2, start_column=2, end_row=2, end_column=10)
        self.ws2.merge_cells(start_row=3, start_column=2, end_row=3, end_column=10)
        self.ws2.cell(row=1, column=2, value=self.ip_url)
        self.ws2.cell(row=2, column=1, value='Headers:')
        self.ws2.cell(row=2, column=2, value=self.test_headers)
        self.ws2.cell(row=3, column=1, value='Body:')
        self.ws2.cell(row=3, column=2, value=str(test_body))
        self._merged_cells = []
        self.spec_value = []

        self._get_spec_value()
        pass

    def _get_merged_cells(self):
        for i in self.ws.merged_cells:
            self._merged_cells.append(range_boundaries(str(i)))

    def _get_spec_value(self):
        self._get_merged_cells()
        merge = []
        for (min_col, min_row, max_col, max_row) in self._merged_cells:
            if min_col == 1:
                merge.append([min_col, min_row, max_col, max_row])

        merge2 = sorted(merge)
        merge_start = 0
        merge_end = 0

        for row in range(1, self.ws.max_row+1):
            try:
                if row == merge2[0][1]:
                    merge_start = merge2[0][1]
                    merge_end = merge2[0][3]
                    self.spec_value.append([str(self.ws.cell(row=row, column=1).value).strip(), [merge2[0][1], merge2[0][3]]])
                    merge2.pop(0)
            except IndexError:
                pass
            if row in range(merge_start, merge_end+1):
                pass
            else:
                self.spec_value.append([str(self.ws.cell(row=row, column=1).value).strip(), row])

    def write_result_to_spec(self):
        spec_value1 = self.spec_value[:]
        flag_spec_value1_key = {}
        flag_m = []
        flagse = 1
